import React from 'react';
// import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <h1 to="/">Nathan Hawk</h1>
      <button className='projects nav-btn' to="/projects">My Projects</button>
      <button className='about-me nav-btn' to="/about">About Me</button>
    </nav>
  );
}

export default Navbar;
